import React from 'react';
// Import Styled Components
import styled from 'styled-components';
import {StyledAbout} from '../styles';
// Import Components 
import Toggle from './Toggle';
import {AnimateSharedLayout} from 'framer-motion';

const FaqSection = () => {
    return(
        <StyledFaq>
            <h2>Any Questions <span>FAQ</span></h2>
            <AnimateSharedLayout>
                <Toggle title="How Do I Start?">
                    <div className="answer">
                        <p>Lorem ipsum dolor sit amet.</p>
                        <p>            
                        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus sit amet diam ut dui 
                        sollicitudin suscipit eget.
                        </p>
                    </div>
                </Toggle>
                <Toggle title="Daily Schedule">
                    <div className="answer">
                        <p>Lorem ipsum dolor sit amet.</p>
                        <p>
                        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus sit amet diam ut dui 
                        sollicitudin suscipit eget.
                        </p>
                    </div>
                </Toggle>
                <Toggle title="Different Payment Methods">
                    <div className="answer">
                        <p>Lorem ipsum dolor sit amet.</p>
                        <p>
                        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus sit amet diam ut dui 
                        sollicitudin suscipit eget.
                        </p>
                    </div>
                </Toggle>
                <Toggle title="What Products Do you Offer?">
                    <div className="answer">
                        <p>Lorem ipsum dolor sit amet.</p>
                        <p>
                        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus sit amet diam ut dui 
                        sollicitudin suscipit eget.
                        </p>
                    </div>
                </Toggle>
            </AnimateSharedLayout>
        </StyledFaq>
    );
};

const StyledFaq = styled(StyledAbout)`
    display: block;
    span{
        display: block;
    }
    h2{
        padding-bottom: 2rem;
        font-weight: lighter;
    }
    .faq-line{
        background: #cccccc;
        height: 0.2rem;
        margin: 2rem 0rem;
        width: 100%;
    }
    .question{
        padding: 3rem 0rem;
        cursor: pointer;
    }
    .answer{
        padding: 2rem 0rem;
        p{
            padding: 1rem 0rem;
        }
    }
`;

export default FaqSection;
